                    } else {
                        System.err.println("Invalid status received: " + response.getStatusLine());
                    }

                break;
                case PUT:

                    if( value!=null ){

                        klass = value.getClass().getName();
                        klass = klass.substring((klass.lastIndexOf('.')+1));

                        content = gson.toJson(value);

                        if(klass.equals("User")){
                            content = "{\"user\":"+content+"}";
                        } else if(klass.equals("Track")){
                            content = "{\"track\":"+content+"}";
                        } else {
                            return null;
                        }

                        resource = Request.to(api.replace(".json","")).withContent(content, "application/json");
                    } else {
                        resource = Request.to(api.replace(".json",""));
                    }

                    response = wrapper.put(resource);

                    if (response.getStatusLine().getStatusCode() == HttpStatus.SC_OK) {
                        String json = (String)(Http.formatJSON(Http.getString(response))).trim();

                        switch(type){
                            case USER:
                                User user = gson.fromJson(replaceJsonsBlank(json), User.class);
                                return (T) user;
                            case TRACK:
                                Track track = gson.fromJson(replaceJsonsBlank(json), Track.class);
                                track.setSoundCloud(this);
                                return (T) track;
                            default: return null;
                        }
                    } else if (response.getStatusLine().getStatusCode() == HttpStatus.SC_CREATED) {
                        return (T) new Boolean(true);
                    } else{
                        System.err.println("Invalid status received: " + response.getStatusLine());
                    }

                break;
                case DELETE:
                    response = wrapper.delete( Request.to(api) );

                    if (response.getStatusLine().getStatusCode() == HttpStatus.SC_OK) {
                        return (T) new Boolean(true);
                    }
                    return (T) new Boolean(false);
            }           

        } catch (Exception e) {
            e.printStackTrace();
        }
        return null;
    }
}

class EmptyClass {

public static Collection<AttributeValue<?>>	extractValues(String datatype, Field field, Object object) throws IllegalArgumentException, IllegalAccessException, DataTypeException {
		DataTypeFactory dtFactory = getDataTypeFactory();
		if (dtFactory == null) {
			logger.error("Could not create data type factory");
			return null;
		}
		Collection<AttributeValue<?>> values = new ArrayList<AttributeValue<?>>();
		Object fieldObject = field.get(object);
		if (logger.isDebugEnabled()) {
			logger.debug(fieldObject);
		}
		if (fieldObject == null) {
			if (logger.isDebugEnabled()) {
				logger.debug("field's object is null.");
			}
			return values;
		}
		if (field.get(object) instanceof Collection || field.get(object) instanceof Map) {
			Collection<?> objects = (Collection<?>) field.get(object);
			if (objects == null || objects.isEmpty()) {
				if (logger.isTraceEnabled()) {
					logger.trace("empty collection");
				}
				return values;
			}
			if (logger.isTraceEnabled()) {
				logger.trace("Object is a collection");
			}
			for (Object obj : objects) {
				values.add(extractValue(datatype, obj));
			}
		} else if (fieldObject.getClass().isArray()) {
			if (logger.isTraceEnabled()) {
				logger.trace("Object is an array");
			}
			for (int i = 0; i < Array.getLength(fieldObject); i++) {
				values.add(extractValue(datatype, Array.get(fieldObject, i)));
			}
		} else {
			values.add(extractValue(datatype, field.get(object)));
		}
		return values;
	}
}

