                entry.id = readId;
                entry.offset = (byte) (response[5] & 0x1f);
                entry.length = (byte) (((response[5] >> 5) & 0x7) + 1);

                entry.source = new byte[3];
                System.arraycopy(response, 2, entry.source, 0, entry.source.length);

                entry.config = new byte[response.length - 6];
