            buffer.append(c);
            if (!isDecimalDigit(c = input.getChar())) {
                throw error(Messages.Key.JSONInvalidNumberLiteral);
            }
        }
        buffer.append(c);
        if (c != '0') {
            while (isDecimalDigit(c = input.getChar())) {
                buffer.append(c);
            }
        } else {
            c = input.getChar();
        }
        if (!(c == '.' || c == 'e' || c == 'E')) {
            input.ungetChar(c);
            return parseSignedInteger(buffer.array(), buffer.length());
        }
        if (c == '.') {
            buffer.append(c);
            if (!isDecimalDigit(c = input.getChar())) {
                throw error(Messages.Key.JSONInvalidNumberLiteral);
            }
            do {
                buffer.append(c);
            } while (isDecimalDigit(c = input.getChar()));
        }
        if (c == 'e' || c == 'E') {
            buffer.append(c);
            c = input.getChar();
            if (c == '+' || c == '-') {
                buffer.append(c);
                c = input.getChar();
            }
            if (!isDecimalDigit(c)) {
                throw error(Messages.Key.JSONInvalidNumberLiteral);
            }
            do {
