		if (!isGetter)
		{
			name = "set" + name;
		}
		else if (boolean.class.isAssignableFrom(field.getType()))
		{
			name = "is" + name;
		}
		else
		{
			name = "get" + name;
		}

		try
		{
			if (isGetter)
			{
				return getMethod(obj, name, null);
			}
			else
			{
				return getMethod(obj, name, new Class[] { field.getType() });
			}
		}
		catch (Exception e1)
		{
		}

		return null;
	}
