        pSt.close();

        pSt = prepareStatement("select * from t2");
        ResultSet rs = pSt.executeQuery();
        JDBC.assertFullResultSet(rs, t2_rows, false);
        rs.close();
        pSt.close();

        try {
            pSt = prepareStatement("select * from t2 where i = ?");
            rs = pSt.executeQuery();
