    public void quadrantRotate(int numquadrants,
                               double anchorx, double anchory)
    {
        switch (numquadrants & 3) {
        case 0:
            return;
        case 1:
            m02 += anchorx * (m00 - m01) + anchory * (m01 + m00);
            m12 += anchorx * (m10 - m11) + anchory * (m11 + m10);
            rotate90();
            break;
        case 2:
            m02 += anchorx * (m00 + m00) + anchory * (m01 + m01);
            m12 += anchorx * (m10 + m10) + anchory * (m11 + m11);
            rotate180();
            break;
        case 3:
            m02 += anchorx * (m00 + m01) + anchory * (m01 - m00);
            m12 += anchorx * (m10 + m11) + anchory * (m11 - m10);
            rotate270();
            break;
        }
        if (m02 == 0.0 && m12 == 0.0) {
            state &= ~APPLY_TRANSLATE;
        } else {
            state |= APPLY_TRANSLATE;
        }
    }
}

class EmptyClass {

private static List<Integer> topologicalSort(HashMap<Integer, List<Integer>> table, HashSet<Integer> visited, List<Integer> order, int index) {
    if (visited.contains(index)) return order;

    visited.add(index);

    List<Integer> neighbors = table.get(index);
    for (int i = 0; i < neighbors.size(); i ++) {
      int neighbor = neighbors.get(i);
      if (visited.contains(neighbor)) {
        if (!order.contains(neighbor)) return null;
        continue;
      }

      order = topologicalSort(table, visited, order, neighbor);
      if (order == null) return null;
    }

    order.add(index);
    return order;
  }
}

