class EmptyClass {

public void paintIcon(Component c, Graphics g, int x, int y) {
            AbstractButton b = (AbstractButton) c;
            ButtonModel model = b.getModel();

            boolean flat = false;

            if(b instanceof JCheckBox) {
                flat = ((JCheckBox)b).isBorderPaintedFlat();
            }

            boolean isPressed = model.isPressed();
            boolean isArmed = model.isArmed();
            boolean isEnabled = model.isEnabled();
            boolean isSelected = model.isSelected();

            boolean checkToggleIn = ((isPressed &&
                                      !isArmed   &&
                                      isSelected) ||
                                     (isPressed &&
                                      isArmed   &&
                                      !isSelected));
            boolean uncheckToggleOut = ((isPressed &&
                                         !isArmed &&
                                         !isSelected) ||
                                        (isPressed &&
                                         isArmed &&
                                         isSelected));

            boolean checkIn = (!isPressed  &&
                               isArmed    &&
                               isSelected  ||
                               (!isPressed &&
                                !isArmed  &&
                                isSelected));


            if(flat) {
                g.setColor(shadow);
                g.drawRect(x+2,y,csize-1,csize-1);
                if(uncheckToggleOut || checkToggleIn) {
                    g.setColor(control);
                    g.fillRect(x+3,y+1,csize-2,csize-2);
                }
            }

            if (checkToggleIn) {
                drawCheckBezel(g,x,y,csize,true,false,false,flat);
            } else if (uncheckToggleOut) {
                drawCheckBezel(g,x,y,csize,true,true,false,flat);
            } else if (checkIn) {
                drawCheckBezel(g,x,y,csize,false,false,true,flat);
            } else if(!flat) {
                drawCheckBezelOut(g,x,y,csize);
            }
        }
}

class EmptyClass {


    @Override
    public void onPlayerStateChange(PlayerState oldState, PlayerState newState, Bundle extra) {

        mPrevState = mCurrentState;
        mCurrentState = newState;
        Log.d(TAG, "State change event! Oldstate= " + oldState + " NewState= " + newState);
        if (mPrevState == mCurrentState) {
            Log.w(TAG, "Duplicate state change message!!! ");
        }
        if (mPrevState == PlayerState.BUFFERING && mCurrentState != PlayerState.BUFFERING) {
            AnalyticsHelper.trackContentAction(AnalyticsTags.ACTION_PLAYBACK_BUFFER_END,
                                               mSelectedContent, getCurrentPosition());
        }
        switch (newState) {
            case IDLE:
                mWindow.clearFlags(WindowManager.LayoutParams.FLAG_KEEP_SCREEN_ON);
                if (mIsContentChangeRequested) {
                    openSelectedContent();
                }
                break;
            case OPENING:
                break;
            case OPENED:
                if (mPlayer != null && mIsActivityResumed) {
                    mPlayer.prepare();
                }
                else {
                    mIsContentChangeRequested = false;
                }
                if (mIsContentSupportCC && mIsCloseCaptionEnabled) {
                    if (mPlaybackOverlayFragment != null) {
                        mPlaybackOverlayFragment.updateCCButtonState(true, true);
                    }
                    if (mPlayer != null) {
                        mPlayer.enableTextTrack(TrackType.SUBTITLE, true);
                    }
                }
                break;
            case PREPARING:
                if (mPlaybackOverlayFragment != null && mPlaybackOverlayFragment.getView() !=
                        null) {
                    mPlaybackOverlayFragment.getView().setVisibility(View.VISIBLE);
                }
                break;
            case READY:
                mPlaybackState = LeanbackPlaybackState.PAUSED;
                if (mPlaybackOverlayFragment != null) {
                    mPlaybackOverlayFragment.togglePlaybackUI(false);
                }
                hideProgress();
                mWindow.clearFlags(WindowManager.LayoutParams.FLAG_KEEP_SCREEN_ON);
                if (mPrevState == PlayerState.PREPARING) {
                    if (mPlaybackOverlayFragment != null) {
                        mPlaybackOverlayFragment.updatePlayback();
                        mPlaybackOverlayFragment.startProgressAutomation();
                    }
                    if (mCurrentPlaybackPosition > 0) {
                        mPlayer.seekTo(mCurrentPlaybackPosition);
                    }
                    if (mAutoPlay || mIsContentChangeRequested) {
                        play();
                        mAutoPlay = false;
                        if (mIsContentChangeRequested) {
                            mIsContentChangeRequested = false;
                        }
                    }
                }
                else if (mAudioFocusState == AudioFocusState.NoFocusNoDuck) {
                    play();
                }

                if (mAdsImplementation != null) {
                    mAdsImplementation.setPlayerState(IAds.PlayerState.PAUSED);
                }
                break;
            case PLAYING:
                mPlaybackState = LeanbackPlaybackState.PLAYING;
                if (mPlaybackOverlayFragment != null) {
                    mPlaybackOverlayFragment.togglePlaybackUI(true);
                }
                hideProgress();
                mWindow.addFlags(WindowManager.LayoutParams.FLAG_KEEP_SCREEN_ON);

                if (mAdsImplementation != null) {
                    mAdsImplementation.setPlayerState(IAds.PlayerState.PLAYING);
                }
                break;
            case BUFFERING:
                showProgress();
                AnalyticsHelper.trackContentAction(AnalyticsTags.ACTION_PLAYBACK_BUFFER_START,
                                                   mSelectedContent, getCurrentPosition());
                break;
            case SEEKING:
                showProgress();
                break;
            case ENDED:
                hideProgress();
                if (mPlaybackOverlayFragment != null) {
                    mPlaybackOverlayFragment.playbackFinished();
                }
                mWindow.clearFlags(WindowManager.LayoutParams.FLAG_KEEP_SCREEN_ON);

                if (mAdsImplementation != null) {
                    mAdsImplementation.setPlayerState(IAds.PlayerState.COMPLETED);
                }
                break;
            case CLOSING:

                if (mPlaybackOverlayFragment != null) {
                    mPlaybackOverlayFragment.stopProgressAutomation();
                }
                if (!isContentLive(mSelectedContent)) {
                    AnalyticsHelper.trackContentFinished(mSelectedContent, getCurrentPosition());
                }
                break;
            case ERROR:
                hideProgress();
                mWindow.clearFlags(WindowManager.LayoutParams.FLAG_KEEP_SCREEN_ON);
                Log.e(TAG, "Player encountered an error!");
                break;
            default:
                Log.e(TAG, "Unknown state!!!!!");
                break;
        }
    }
}

class EmptyClass {


	public void openOrder(int orderId, com.ib.client.Contract contractIB, com.ib.client.Order order,
			OrderState orderState) {
		try {

			TWSBrokerModel.logOrderState(orderState);
			TWSBrokerModel.logTradeOrder(order);

			TradeOrder transientInstance = m_tradePersistentModel.findTradeOrderByKey(new Integer(order.m_orderId));

			if (null == transientInstance) {
				error(orderId, 3170,
						"Warning Order not found for Order Key: " + order.m_orderId + " make sure Client ID: "
								+ this.m_clientId + " is not the master in TWS. On openOrder update.");
				transientInstance = new TradeOrder();
				transientInstance.setOrderKey(order.m_orderId);
				transientInstance.setCreateDate(TradingCalendar.getDateTimeNowMarketTimeZone());
				TWSBrokerModel.updateTradeOrder(order, orderState, transientInstance);
				openOrders.put(transientInstance.getOrderKey(), transientInstance);
				return;
			}



			if (TWSBrokerModel.updateTradeOrder(order, orderState, transientInstance)) {

				if (OrderStatus.FILLED.equals(transientInstance.getStatus())) {
					_log.debug("Open order filled Order Key:" + transientInstance.getOrderKey());
					transientInstance = m_tradePersistentModel.persistTradeOrder(transientInstance);

					if (transientInstance.hasTradePosition() && !transientInstance.getTradePosition().isOpen()) {
						this.firePositionClosed(transientInstance.getTradePosition());
					}
				} else {
					_log.debug("Open order state changed. Status:" + orderState.m_status);
					transientInstance = m_tradePersistentModel.persistTradeOrder(transientInstance);
					if (OrderStatus.CANCELLED.equals(transientInstance.getStatus())) {
						this.fireTradeOrderCancelled(transientInstance);
					} else {
						this.fireTradeOrderStatusChanged(transientInstance);
					}
				}
			}
			openOrders.put(transientInstance.getOrderKey(), transientInstance);
		} catch (Exception ex) {
			error(orderId, 3180, "Errors updating open order: " + ex.getMessage());
		}
	}
}

